function PlaylistCard(props) {


    props = { ...props }

    return (
        <div>
            <div>
                playlist id: {props.playlistInfo.id}
            </div>
            <div>
                playlist name: {props.name}
            </div>
            <div>
                playlist image: {props.image}
            </div>
            <div>
                playlist description: {props.description}
            </div>
            <div>
                playlist href: {props.href}
            </div>
        </div>
    )
}

export default PlaylistCard
